(1, 'ynisfv-qwluaz-sgtzqx-reanft-hmcosq', 1, 'Welcome To Email Subscribers', '<strong style=\"color: #990000\">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters & automatically notify subscribers about new blog posts once it is published. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br>Admin', 2, 'Sent', '2019-10-15 08:20:02', '2019-10-15 09:22:26', NULL, '2019-10-15 08:20:02', '2019-10-15 08:20:02'),
(2, 'uwizdh-zbwerx-nafyxs-limwcv-knmsiw', 2, 'New Post Published - Hello world!', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Hello world!</p>\n<p>You can view it from this link : <a href=\'http://localhost/zillion/hello-world/\' target=\'_blank\'>http://localhost/zillion/hello-world/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 2, 'Sent', '2019-10-15 08:20:02', '2019-10-15 09:32:24', NULL, '2019-10-15 08:20:02', '2019-10-15 08:20:02'),
(3, 'dxcpse-jiesdf-wdrnib-ardzvn-ctaeln', 2, 'New Post Published - Enabling a secure ecosystem of connected the devices', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Enabling a secure ecosystem of connected the devices<br />\n<a href=\'http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices/\' target=\'_blank\'><img width=\"260\" height=\"157\" src=\"http://192.168.88.80/zillion/wp-content/uploads/2019/10/hero-pricing-distributors.png\" class=\"attachment-medium size-medium wp-post-image\" alt=\"\" /></a></p>\n<p>You can view it from this link : <a href=\'http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices/\' target=\'_blank\'>http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 3, 'Sent', '2019-10-16 05:47:57', '2019-10-16 05:47:57', 'a:2:{s:7:\"post_id\";i:120;s:4:\"type\";s:17:\"post_notification\";}', '2019-10-16 05:42:09', '2019-10-16 05:42:09'),
(4, 'hqwmuy-bizogq-dcyrtw-cxnbsi-hbevan', 2, 'New Post Published - Enabling a secure ecosystem of connected the devices', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Enabling a secure ecosystem of connected the devices<br />\n<a href=\'http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices-2/\' target=\'_blank\'><img width=\"260\" height=\"157\" src=\"http://192.168.88.80/zillion/wp-content/uploads/2019/10/how-state-and-local-standard.png\" class=\"attachment-medium size-medium wp-post-image\" alt=\"\" /></a></p>\n<p>You can view it from this link : <a href=\'http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices-2/\' target=\'_blank\'>http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices-2/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 3, 'Sent', '2019-10-16 06:02:35', '2019-10-16 06:02:35', 'a:2:{s:7:\"post_id\";i:126;s:4:\"type\";s:17:\"post_notification\";}', '2019-10-16 05:44:26', '2019-10-16 05:44:26'),
(5, 'jcgvlu-zacdsu-euyfgm-wjrocz-fbcyae', 2, 'New Post Published - Cybersecurity: The Key to the digital enterprise', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Cybersecurity: The Key to the digital enterprise<br />\n<a href=\'http://192.168.88.80/zillion/cybersecurity-the-key-to-the-digital-enterprise/\' target=\'_blank\'><img width=\"300\" height=\"168\" src=\"http://192.168.88.80/zillion/wp-content/uploads/2019/10/wisdom-300x168.png\" class=\"attachment-medium size-medium wp-post-image\" alt=\"\" srcset=\"http://192.168.88.80/zillion/wp-content/uploads/2019/10/wisdom-300x168.png 300w, http://192.168.88.80/zillion/wp-content/uploads/2019/10/wisdom-768x431.png 768w, http://192.168.88.80/zillion/wp-content/uploads/2019/10/wisdom-1024x575.png 1024w, http://192.168.88.80/zillion/wp-content/uploads/2019/10/wisdom.png 1126w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a></p>\n<p>You can view it from this link : <a href=\'http://192.168.88.80/zillion/cybersecurity-the-key-to-the-digital-enterprise/\' target=\'_blank\'>http://192.168.88.80/zillion/cybersecurity-the-key-to-the-digital-enterprise/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 3, 'Sent', '2019-10-16 06:17:25', '2019-10-16 06:17:25', 'a:2:{s:7:\"post_id\";i:128;s:4:\"type\";s:17:\"post_notification\";}', '2019-10-16 05:48:38', '2019-10-16 05:48:38'),
(6, 'vxfnek-rgxqjy-znjgay-pdbhsn-gtnlrh', 2, 'New Post Published - Enabling a secure ecosystem of connected the devices', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Enabling a secure ecosystem of connected the devices<br />\n<a href=\'http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices-2/\' target=\'_blank\'><img width=\"260\" height=\"157\" src=\"http://192.168.88.80/zillion/wp-content/uploads/2019/10/how-state-and-local-standard.png\" class=\"attachment-medium size-medium wp-post-image\" alt=\"\" /></a></p>\n<p>You can view it from this link : <a href=\'http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices-2/\' target=\'_blank\'>http://192.168.88.80/zillion/enabling-a-secure-ecosystem-of-connected-the-devices-2/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 3, 'Sent', '2019-10-17 13:18:40', '2019-10-17 13:18:40', 'a:2:{s:7:\"post_id\";i:126;s:4:\"type\";s:17:\"post_notification\";}', '2019-10-17 13:12:20', '2019-10-17 13:12:20');
