(53, 1, '2019-10-15 04:45:33', '2019-10-15 04:45:33', '<p>We help organizations across the <a href=\"#\">private, public, and social sectors</a> create the change that matters. We have always helped our clients identify and set the direction <a href=\"#\">toward their most important</a> goals. Today, we go further: working together to turn these ambitious goals into reality.</p> <p>From the C-suite to the front line, we partner with our clients to transform their organizations in the ways that matter most to them. This means embedding digital, analytics, and design into core processes and mind-sets; <a href=\"#\">building capabilities that help organizations</a> and people to thrive in an ever-changing context; and developing excellence in execution to ensure that actions translate into outcomes, quickly and sustainably.</p> \r\n          <p>With <a href=\"\">exceptional people in 10 countries</a>, we combine global expertise and local insight to help you create the change that truly matters.</p>', 'Who are we', '', 'publish', 'closed', 'closed', '', 'who-are-we', '', '', '2019-10-17 06:09:40', '2019-10-17 06:09:40', '', 0, 'http://192.168.88.80/zillion/?page_id=53', 0, 'page', '', 0),
